import React, { Component } from 'react';
import { Container } from 'react-bootstrap';

class ExpertCalender extends Component{
    render(){
        return(
            <>
                <Container>
                    <h1>{this.props.name}</h1>
                </Container>
            </>
        )
    }
}

export default ExpertCalender;
